  CONSTRAINT `fk_lapt_compañia_cpu` FOREIGN KEY (`CPU_company`) REFERENCES `compañia_cpu` (`cpuc_code`),
  CONSTRAINT `fk_lapt_compañia_gpu` FOREIGN KEY (`GPU_company`) REFERENCES `compañia_gpu` (`gpuc_code`),
  CONSTRAINT `fk_lapt_modelo_cpu` FOREIGN KEY (`CPU_model`) REFERENCES `modelo_cpu` (`cpum_code`),
  CONSTRAINT `fk_lapt_modelo_gpu` FOREIGN KEY (`GPU_model`) REFERENCES `modelo_gpu` (`gpum_code`),
  CONSTRAINT `fk_lapt_ram` FOREIGN KEY (`Ram`) REFERENCES `ram` (`ram_code`),
  CONSTRAINT `fk_lapt_so` FOREIGN KEY (`OS`) REFERENCES `so` (`sop_code`)
